import { Fragment } from "react";
import {
  createBrowserRouter,
  RouterProvider,
  Link,
  Params,
} from "react-router-dom";
import "./index.css";
import "./App.css";
import Website from "./Main-Folder/webiste/website";

const router = createBrowserRouter([
  { path: "/", element: <Website /> },
  { path: '/login'}
]);


function App() {
  return (
    <div>
      <RouterProvider router={router} />
    </div>
  );
}

export default App;
